import React from 'react';
import {SafeAreaView, Text, View } from 'react-native';
import TopBar from '../../components/Common/TopNavBar';

const Documents = () => {
    return (
      <SafeAreaView >
        <TopBar/>
        <Text>DocumentsScreen</Text>
      </SafeAreaView>
    );
  };

  export default Documents;
